// src/pages/Home.js
import React from 'react';
import '../styles/Home.css';
import { Link } from 'react-router-dom';

const Home = () => {
  return (
    <div className="home-container">
      <section className="hero-section">
        <div className="hero-left">
          <h1 className="hero-title">Anomaly Detection with AI</h1>
          <p className="hero-subtext">
            Power your industrial quality control with transformer-based AI models and synthetic training data.
          </p>
          <Link to="/login" className="hero-button">Get Started</Link>
        </div>

        <div className="hero-right">
          {/* Placeholder for image or graphic */}
          <div className="hero-image-placeholder">[ Image ]</div>
        </div>
      </section>
    </div>
  );
};

export default Home;
